import React, {Component}  from 'react';
import Cell from '../images/1.png';

class Board extends Component {

  render(){
      return(
        <div className='board'>
           {/* <Cell/> */}
            <div className='row together '>
              <div className='block-example border border-dark rounded'>
                 <img src={Cell} alt="missed" className='square'></img>
              </div>
               <img src={Cell} alt="missed" className='square'></img>  
               <img src={Cell} alt="missed" className='square'></img>
               <img src={Cell} alt="missed" className='square'></img>

            </div>

        </div>
    );
  }
}

export default Board;
